SET NAMES utf8;
SET time_zone = '+00:00';
SET foreign_key_checks = 0;
SET sql_mode = 'NO_AUTO_VALUE_ON_ZERO';

CREATE DATABASE `Telangana_growth_analysis` /*!40100 DEFAULT CHARACTER SET latin1 */;
USE `Telangana_growth_analysis`;

CREATE TABLE dim_date(
   month       VARCHAR(10) NOT NULL PRIMARY KEY
  ,Mmm         VARCHAR(3) NOT NULL
  ,quarter     VARCHAR(2) NOT NULL
  ,fiscal_year VARCHAR(4) NOT NULL
);

CREATE TABLE dim_districts(
   dist_code VARCHAR(4) NOT NULL PRIMARY KEY
  ,district  VARCHAR(23) NOT NULL
);

CREATE TABLE fact_stamps(
   dist_code                VARCHAR(4) NOT NULL 
  ,month                    DATE  NOT NULL
  ,documents_registered_cnt INTEGER  NOT NULL
  ,documents_registered_rev INTEGER  NOT NULL
  ,estamps_challans_cnt     INTEGER  NOT NULL
  ,estamps_challans_rev     INTEGER  NOT NULL
);

CREATE TABLE fact_transport(
   dist_code                 VARCHAR(4) NOT NULL 
  ,month                     DATE  NOT NULL
  ,fuel_type_petrol          INTEGER  NOT NULL
  ,fuel_type_diesel          INTEGER  NOT NULL
  ,fuel_type_electric        INTEGER  NOT NULL
  ,fuel_type_others          INTEGER  NOT NULL
  ,vehicleClass_MotorCycle   INTEGER  NOT NULL
  ,vehicleClass_MotorCar     INTEGER  NOT NULL
  ,vehicleClass_AutoRickshaw INTEGER  NOT NULL
  ,vehicleClass_Agriculture  INTEGER  NOT NULL
  ,vehicleClass_others       INTEGER  NOT NULL
  ,seatCapacity_1_to_3       INTEGER  NOT NULL
  ,seatCapacity_4_to_6       INTEGER  NOT NULL
  ,seatCapacity_above_6      INTEGER  NOT NULL
  ,Brand_new_vehicles        INTEGER  NOT NULL
  ,Preowned_vehicles         INTEGER  NOT NULL
  ,category_NonTransport     INTEGER  NOT NULL
  ,category_Transport        INTEGER  NOT NULL
);
CREATE TABLE fact_TS_iPASS(
   dist_code           VARCHAR(4) NOT NULL 
  ,month               DATE  NOT NULL
  ,sector              VARCHAR(75) NOT NULL
  ,investment_in_cr    NUMERIC(10,4) NOT NULL
  ,number_of_employees INTEGER  NOT NULL
);

